int CheckTabs(int x, int y, int w, int h)
{
	if (ShowMenu)
	{
		GetCursorPos(&cPos);
		ScreenToClient(GetForegroundWindow(), &cPos);
		if (cPos.x > x && cPos.x < x + w && cPos.y > y && cPos.y < y + h)
		{
			if (GetAsyncKeyState(VK_LBUTTON) & 1)
			{
				//return 1; //mouse selection OFF
			}
			return 2;
		}
	}
	return 0;
}

void AddItem(LPDIRECT3DDEVICE9 pDevice, char *text, int &var, char **opt, int MaxValue)
{
	if (ShowMenu)
	{
		int Check = CheckTabs(MenuPosX, MenuPosY + (Current * 25), 190, 10);
		DWORD ColorText;

		if (var)
		{
			//DrawBox(pDevice, PosX, PosY + (Current * 15), 10, 10, Green);
			ColorText = ItemColorOn;
		}
		if (var == 0)
		{
			//DrawBox(pDevice, PosX, PosY + (Current * 15), 10, 10, Red);
			ColorText = ItemColorOff;
		}

		if (Check == 1)
		{
			var++;
			if (var > MaxValue)
				var = 0;
		}

		if (Check == 2)
			ColorText = ItemCurrent;

		if (MenuSelection == Current)
		{
			if (GetAsyncKeyState(VK_RIGHT) & 1)
			{
				var++;
				if (var > MaxValue)
					var = 0;
			}
			else if (GetAsyncKeyState(VK_LEFT) & 1)
			{
				var--;
				if (var < 0)
					var = MaxValue;
			}
		}

		if (MenuSelection == Current)
			ColorText = ItemCurrent;

		TextWithBorder(guiFont, MenuPosX + 10, MenuPosY + (Current * 25) - 1, ColorText, text, alignLeft);
		TextWithBorder(guiFont, MenuPosX + 190, MenuPosY + (Current * 25) - 1, ColorText, opt[var], alignRight);
		Current++;
	}
}


void BuildMenu(LPDIRECT3DDEVICE9 pDevice)
{
	if (ShowMenu) {
		if (GetAsyncKeyState(VK_UP) & 1)	MenuSelection--;
		if (GetAsyncKeyState(VK_DOWN) & 1)	MenuSelection++;

		MenuPosX = Viewport.Width - 200;
		MenuPosY = 40;

		DrawRectangle(pDevice, (FLOAT)MenuPosX, (FLOAT)MenuPosY, 200, 240, Black);
		TextWithBorder(guiFont, MenuPosX + 100, MenuPosY + 5, LightYellow, "[Overlay Menu]", alignCenter);

		Current = 1;
		int iShowOverlay = ShowOverlay ? 1 : 0;
		int iXray = bXray ? 1 : 0;
		int iSpecMode = bSpecmode ? 1 : 0;
		int iNoFow = bNoFow ? 1 : 0;
		int iNoFlash = bNoFlash ? 1 : 0;
		int iswapTeamNames = swapTeamNames;

		AddItem(pDevice, " Overlay", iShowOverlay, opt_OnOff, 1);
		AddItem(pDevice, " X-ray", iXray, opt_OnOff, 1);
		AddItem(pDevice, " Free Look", iSpecMode, opt_OnOff, 1);
		AddItem(pDevice, " No FOW", iNoFow, opt_OnOff, 1);
		AddItem(pDevice, " No Flash", iNoFlash, opt_OnOff, 1);
		AddItem(pDevice, " Swap names", iswapTeamNames, opt_OnOff, 1);
		AddItem(pDevice, " Transparency", iTransparency, opt_OnOff, 1);
		AddItem(pDevice, " DMG Dealt", iShowDMGDealt, opt_showdmg, 3);

		if ((int)bSpecmode != iSpecMode)
		{
			bSpecmode = iSpecMode;

			DWORD localPlayer = *(DWORD*)0x006CC294;
			DWORD Specmodeaddr = *(DWORD*)0x006CC400;

			int localplayer_tid = *(int*)(localPlayer + 0x134);
			if (bSpecmode && localplayer_tid == 0) {
				OldSpecmode = *(int*)(Specmodeaddr + 0x19);
				*(int*)(Specmodeaddr + 0x19) = 1;
			}
			else if (!bSpecmode && localplayer_tid == 0)
			{
				*(int*)(Specmodeaddr + 0x19) = OldSpecmode;
			}
		}


		if (MenuSelection >= Current)
			MenuSelection = 1;

		if (MenuSelection < 1)
			MenuSelection = Current;

		ShowOverlay = iShowOverlay;

		if ((int)bXray != iXray)
		{
			bXray = iXray;
			XrayHook();
		}

		if ((int)bNoFow != iNoFow) 
		{
			bNoFow = iNoFow;
			NoFow(bNoFow);
		}
		
		if ((int)bNoFlash != iNoFlash)
		{
			bNoFlash = iNoFlash;
			NoFlash(bNoFlash);
		}

		if (iswapTeamNames != swapTeamNames)
		{
			string tmp;
			tmp = team1;
			team1 = team2;
			team2 = tmp;
			swapTeamNames = iswapTeamNames;
		}
	}

}

void BuildOverlay(LPDIRECT3DDEVICE9 pDevice)
{
	if (ShowOverlay) {
		DWORD localPlayer = *(DWORD*)0x006CC294;

		int localplayer_tid = *(int*)(localPlayer + 0x134);

		string dollar = "$";
		string ammo = "";
		string kd = "";
		string dmg = "";
		string strHP = "";
		int maxPlayers = 32;
		int countCT = 0;
		int countTT = 0;
		int pTID = 0;

		int bar_x = 10, bar_y = (int)screenCenterY + HPBarPosY,  bar_height = 46, bar_thickness = 3;

		int recalc_bar_x = bar_x;
		int recalc_bar_y = bar_y;
		int weapon_x =  0;
		int ico_x = 0;
		int ico_y = 0;
		int ico_width = 32;
		int cash_x = 0;
		int cash_y = 0;
		int	curHP_x = 0;
		int curHP_y = 0;
		int nick_x = 0;
		int nick_y = 0;

		if (Viewport.Width == 640 && Viewport.Height == 480)
		{
			bar_height = bar_height / 2;
			bar_thickness = 2;
			ico_width = 0;
		}

		if (bNewRound)
		{
			//if (iShowDMGDealt > 0) iShowDMGDealt = 3;
			NewRound();
		}

		int rt = GetRoundTime();

		if (rt > 0 && rt < 5 && (iShowDMGDealt == 1 || iShowDMGDealt == 3))
		{
			iShowDMGDealt = 2;
		}
		else if (rt >= 5 && rt <= 7 && (iShowDMGDealt == 1 || iShowDMGDealt == 2))
		{
			iShowDMGDealt = 3;
		}
		else if (rt == 120 && (iShowDMGDealt == 2 || iShowDMGDealt == 3))
		{
			iShowDMGDealt = 1;
		}
		
		int SpectatedPID = GetSpectatedPlayerID();
		bool isFollowingP = isFollowingPlayer();

		DWORD HPColor;
		DWORD BarColor = HPBarBorder;
		DrawScore(pDevice);
		//DWORD gametick;

		sprIcon->Begin(D3DXSPRITE_ALPHABLEND);
		sprLogo->Begin(D3DXSPRITE_ALPHABLEND);
		DrawICCLogo(pDevice, ICCLogoXPos, ICCLogoYPos);

		for (int i = 1; i <= maxPlayers; i++) {

			if (countCT >= 5 && countTT >= 5) break; // Support only up to 10 players.

			//gametick = timeGetTime();
			CPlayer * pPlayer = GetPlayer(i); // Get player address by given index
			//Log("[Get playerTime] [Index: %i] [%i ms.]",i ,timeGetTime() - gametick);

			if (!pPlayer || pPlayer->curHP <= 0 ||pPlayer->TeamID == 0) continue;
	
			//MessageBox(NULL, to_string((DWORD)&HP).c_str(), "Error", MB_OK);


			//Get and convert nickname
			size_t nameSize = pPlayer->ptrCname->NicknameLen + 1;
			size_t convertedChars = 0;
			char *pName = new char[nameSize];
			wcstombs_s(&convertedChars, pName, nameSize, pPlayer->ptrCname->Nickname, pPlayer->ptrCname->NicknameLen);

			if (localplayer_tid == 0 && SpectatedPID == pPlayer->playerID && isFollowingP) {
				//DrawRectangle(pDevice, 0.0f, (float)(Viewport.Height-70), 260.0f, 70.0f, D3DCOLOR_ARGB(140, 20, 22, 24));	// border

				// HP
				DrawTexture(10, Viewport.Height - (64 + 10), texSymHP, sprIcon, FALSE); // HP Icon
				TextWithBorder(symbolFont, 10 + 32 + 5, Viewport.Height - (60 + 15), GreenYellow, (char*)to_string(pPlayer->curHP).c_str(), alignLeft); // Current HP

				// Armor
				DrawTexture(113, Viewport.Height - (64 + 10), texSymArm, sprIcon, FALSE); // Armor Icon
				TextWithBorder(symbolFont, 113 + 32 + 5, Viewport.Height - (60 + 15), GreenYellow, (char*)to_string(pPlayer->Armor).c_str(), alignLeft); // Current Armor

				// Money
				dollar.append(to_string(pPlayer->Money)); 
				TextWithBorder(symbolFont, Viewport.Width - 10, Viewport.Height - 105, GreenYellow, (char*)dollar.c_str(), alignRight);
				dollar = "$";

				// Ammo
				if (pPlayer->ptrWeapon->AmmoIn > 0 && pPlayer->ptrWeapon->Ammo > 0) {
					ammo.append(to_string(pPlayer->ptrWeapon->AmmoIn));
					ammo.append(" / ");
					ammo.append(to_string(pPlayer->ptrWeapon->Ammo));
					TextWithBorder(symbolFont, Viewport.Width - 10, Viewport.Height - 75, GreenYellow, (char*)ammo.c_str(), alignRight);
					ammo = "";
				}
			}
			
			pTID = pPlayer->TeamID;

			if (pTID == 1) {
				
				/*
				if (MessageBox(NULL, pName, "Error", MB_OK)) {
					MessageBox(NULL, to_string(GetRoundTime()).c_str(), "Error", MB_OK);
					ShowOverlay = FALSE;
				}
				*/

				if (countTT == 5) continue;

				// Terrorists
				HPColor = TTBar;
				recalc_bar_y = bar_y - ((bar_height + (bar_thickness * 2) + 3) * (countTT + 1));
				weapon_x = bar_x + bar_width + 10;
				ico_x = bar_x + bar_thickness;
				ico_y = recalc_bar_y + (bar_height / 2);
				cash_x = bar_x + (bar_width - 50);
				cash_y = ico_y;
				curHP_x = bar_x + bar_thickness;
				curHP_y = recalc_bar_y + 2;
				nick_x = bar_x + 30;
				nick_y = recalc_bar_y + 2;

				if (localplayer_tid == 0 && SpectatedPID == pPlayer->playerID && isFollowingP) BarColor=Grey;
	
				DrawHealthbar(pDevice, bar_x, recalc_bar_y, pPlayer->curHP, pPlayer->Armor, bar_width, bar_height, bar_thickness, BarColor, HPColor, FALSE);

				DrawWeapon(pDevice, weapon_x, recalc_bar_y, pPlayer->TeamID, pPlayer->ptrWeapon->WeaponID);
				if (pPlayer->hasBomb && Viewport.Width / Viewport.Height > 1.4) DrawTexture(ico_x, ico_y, texIcoC4, sprIcon, FALSE);  //DrawIcon(pDevice, bar_x + bar_thickness, recalc_bar_y + (bar_height / 2), icons_c4, sizeof(icons_c4));

				// Score
				iPlayersScore[pPlayer->playerID] = pPlayer->playerScore;
				iPlayersDeaths[pPlayer->playerID] = pPlayer->playerDeaths;

				if (bSwap)
				{
					iPlayersScore[pPlayer->playerID] += iSavedPlayersScore[pPlayer->playerID];
					iPlayersDeaths[pPlayer->playerID] += iSavedPlayersDeaths[pPlayer->playerID];
				}

				kd.append(to_string(iPlayersScore[pPlayer->playerID]));
				kd.append("/");
				kd.append(to_string(iPlayersDeaths[pPlayer->playerID]));
				TextWithBorder(guiFont, cash_x - 5, ico_y, White, (char*)kd.c_str(), alignRight);
				kd = "";

				// DMG
				if (iShowDMGDealt == 1)
				{
					dmg.append("DMG: ");
					dmg.append(to_string(iDmgDealtCurrent[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x + ico_width, ico_y, White, (char*)dmg.c_str(), alignLeft);
					dmg = "";
				}
				else if (iShowDMGDealt == 2) {
					dmg.append("LAST: ");
					dmg.append(to_string(iDmgDealtLast[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x + ico_width, ico_y, White, (char*)dmg.c_str(), alignLeft);
					dmg = "";
				}
				else if (iShowDMGDealt == 3) {
					dmg.append("TOTAL: ");
					dmg.append(to_string(iDmgDealtTotal[pPlayer->playerID] + iDmgDealtTotalSaved[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x + ico_width, ico_y, White, (char*)dmg.c_str(), alignLeft);
					dmg = "";
				}

				dollar.append(to_string(pPlayer->Money));
				TextWithBorder(guiFont, cash_x, cash_y, Gold, (char*)dollar.c_str(), alignLeft);
				strHP.append(to_string(pPlayer->curHP));
				//strHP.append("|");
				//strHP.append(to_string(pPlayer->Armor));
				TextWithBorder(guiFont, curHP_x, curHP_y, White, (char*)strHP.c_str(), alignLeft); // Write on screen player curHP
				strHP = "";

				TextWithBorder(guiFont, nick_x, nick_y, White, pName, alignLeft); // Write on screen player nickname

				BarColor = HPBarBorder;
				countTT++;
			} else if (pTID == 2) {
				// Counter Terrorists

				if (countCT == 5) continue;

				HPColor = CTBar;
				recalc_bar_x = Viewport.Width - (bar_x + bar_width);
				recalc_bar_y = bar_y - ((bar_height + (bar_thickness * 2) + 3) * (countCT + 1));
				weapon_x = recalc_bar_x - 25;
				ico_x = Viewport.Width - (bar_x + bar_thickness + 18 + 6);
				ico_y = recalc_bar_y + (bar_height / 2);
				cash_x = Viewport.Width - (bar_x + 5 + (bar_width - 10));
				cash_y = ico_y;
				curHP_x = Viewport.Width - (bar_x + bar_thickness + 5);
				curHP_y = recalc_bar_y + 2;
				nick_x = Viewport.Width - (bar_x + 35);
				nick_y = recalc_bar_y + 2;

				if (localplayer_tid == 0 && SpectatedPID == pPlayer->playerID && isFollowingP) BarColor = Grey;

				recalc_bar_x = Viewport.Width - (bar_x + bar_width);
				recalc_bar_y = bar_y - ((bar_height + (bar_thickness * 2) + 3) * (countCT + 1));
				weapon_x = recalc_bar_x - 25;

				DrawHealthbar(pDevice, recalc_bar_x, recalc_bar_y, pPlayer->curHP, pPlayer->Armor, bar_width, bar_height, bar_thickness, BarColor, HPColor, TRUE);

				DrawWeapon(pDevice, weapon_x, recalc_bar_y, pPlayer->TeamID, pPlayer->ptrWeapon->WeaponID);
				if (pPlayer->hasDefuser && Viewport.Width / Viewport.Height > 1.4) DrawTexture(ico_x, ico_y, texIcoDef, sprIcon, FALSE); // DrawIcon(pDevice, Viewport.Width - (bar_x + bar_thickness + 18 + 6), recalc_bar_y + (bar_height / 2), icons_defuser, sizeof(icons_defuser));

				// Score
				iPlayersScore[pPlayer->playerID] = pPlayer->playerScore;
				iPlayersDeaths[pPlayer->playerID] = pPlayer->playerDeaths;

				if (bSwap)
				{
					iPlayersScore[pPlayer->playerID] += iSavedPlayersScore[pPlayer->playerID];
					iPlayersDeaths[pPlayer->playerID] += iSavedPlayersDeaths[pPlayer->playerID];
				}

				kd.append(to_string(iPlayersScore[pPlayer->playerID]));
				kd.append("/");
				kd.append(to_string(iPlayersDeaths[pPlayer->playerID]));
				TextWithBorder(guiFont, cash_x + 48, ico_y, White, (char*)kd.c_str(), alignLeft);
				kd = "";

				// DMG
				if (iShowDMGDealt == 1)
				{
					dmg.append("DMG: ");
					dmg.append(to_string(iDmgDealtCurrent[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x - ico_width, ico_y, White, (char*)dmg.c_str(), alignRight);
					dmg = "";
				}
				else if (iShowDMGDealt == 2) {
					dmg.append("LAST: ");
					dmg.append(to_string(iDmgDealtLast[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x - ico_width, ico_y, White, (char*)dmg.c_str(), alignRight);
					dmg = "";
				}
				else if (iShowDMGDealt == 3) {
					dmg.append("TOTAL: ");
					dmg.append(to_string(iDmgDealtTotal[pPlayer->playerID] + iDmgDealtTotalSaved[pPlayer->playerID]));
					TextWithBorder(guiFont, ico_x - ico_width, ico_y, White, (char*)dmg.c_str(), alignRight);
					dmg = "";
				}

				dollar.append(to_string(pPlayer->Money));
				TextWithBorder(guiFont, cash_x, cash_y, Gold, (char*)dollar.c_str(), alignLeft);

				strHP.append(to_string(pPlayer->curHP));
				//strHP.append("|");
				//strHP.append(to_string(pPlayer->Armor));
				TextWithBorder(guiFont, curHP_x, curHP_y, White, (char*)strHP.c_str(), alignRight); // Write on screen player curHP
				strHP = "";

				TextWithBorder(guiFont, nick_x, nick_y, White, pName, alignRight);

				BarColor = HPBarBorder;
				countCT++;
			}
			dollar = "$";

		}
	}
	sprIcon->End();
	sprLogo->End();
}
